import React from "react";
import './index.css';
// import { Link } from "react-router-dom";
const Navbar=()=>{
    return(
        <div>
            <h1>This is navbar</h1>
            <div className="nav">
            <ul>
               <li>
                    Home
                </li>
                      <li>
                    Dashboard
                </li>
              <li>
                    About
                </li>
            </ul>
            </div>
        </div>
    )
}
export default Navbar
